import React from 'react';

class Form extends React.Component {
  render() {
    return (
      <form
        className="form" 
        onSubmit={this.props.handleSubmit}>

        <input
          className="inputField" 
          type="text" 
          onChange={this.props.handleChange} 
          placeholder="Enter City"
        />

        <input
          className="submitButton" 
          type="submit" 
          value="Submit"
        />
      </form>
  )
}
}


export default Form ;
